        ⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯

          Congratulations on the purchase of your new expeditionary vessel. To ensure proper operation and avoid damages, injuries or a loss of productivity please take the time to go through the startup procedure for this vessel. As a ship that is primarily a lightly crewed planetary gas miner, there will be some extra steps required to render your vessel fully operational.

        ⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯


        [head=3]Pre-Flight Checklist:[/head]
          ◗ Ensure the generator is running. 25kW should cover the ship as delivered
          ◗ Configure the air alarms from within the atmos observation area. The starboard chamber leads to breathable air tanks, the port side chamber is to be used for volatile gases.
          ◗ The atmosphere in the living quarters may require manual refilling after several hours of continuous use. This can be done using the filled cans on the exterior platform.

        ⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯⎯


        [head=3]General advice:[/head]

          ◗ While considered "technically safe", advise all crew against being on the exterior walkways before commencing FTL-procedures. 

          ◗ In the event of cataclysmic hellfires, or other undesirable conditions in one or both of the atmospheric holding chambers, please use the provdided remotes to vent out all gases and safely reset the environment for future use.

          ◗ While tap water is available, it is advised that for reasons of cleanliness and morale all crew drink a beverage known as 'Grog' instead.

          ◗ In case of emergencies or maintenance the shutters located in the living area and medbay can be used to access the thrusters from the interior of the ship. 

          ◗ Do not under any circumstances eat any pills found aboard the vessle.
